// RSI-Based Trading Strategy

function executeStrategy(symbol) {
  const period = parameters.rsiPeriod; // RSI calculation period
  const cash = portfolio.cash; // Available cash for trading
  const maxPositionSize = parameters.maxPositionSize; // Maximum position size as a percentage of total capital

  // Retrieve historical price data for the symbol
  const prices = data[symbol].map(point => point.close);
  const timestamps = data[symbol].map(point => point.timestamp);

  // Calculate the current RSI value
  const currentRsi = rsi(prices, period);

  // Determine the last RSI value and corresponding timestamp
  const lastRsi = currentRsi[currentRsi.length - 1];
  const lastTimestamp = timestamps[timestamps.length - 1];

  // Check current position for the symbol
  const currentPosition = portfolio.positions[symbol] || 0;

  // Trading logic
  if (lastRsi > 30 && lastRsi <= 50 && currentPosition === 0) {
    // Buy signal: RSI has crossed above 30 and is below or equal to 50
    const price = prices[prices.length - 1]; // Current price
    const quantity = Math.floor((cash * maxPositionSize) / price); // Buy as much as allowed by max position size

    if (quantity > 0) {
      buy(symbol, quantity, price, lastTimestamp);
    }
  } else if (lastRsi >= 70 && currentPosition > 0) {
    // Sell signal: RSI has reached or exceeded 70
    const price = prices[prices.length - 1]; // Current price

    sell(symbol, currentPosition, price, lastTimestamp);
  }
}

// Example execution
executeStrategy('AAPL');

function momentumBreakoutWithVolume() {
  const symbol = parameters.symbol || 'AAPL';
  const breakoutPeriod = parameters.breakoutPeriod || 20;
  const volumeMultiplier = parameters.volumeMultiplier || 1.5;
  const rsiPeriod = parameters.rsiPeriod || 14;
  const overboughtThreshold = parameters.overboughtThreshold || 70;
  const oversoldThreshold = parameters.oversoldThreshold || 30;

  const historicalData = data[symbol];

  if (historicalData.length < breakoutPeriod + rsiPeriod) {
    console.log('Not enough data to analyze.');
    return;
  }

  const closePrices = historicalData.map(d => d.close);
  const volumeData = historicalData.map(d => d.volume);

  const smaClose = sma(closePrices, breakoutPeriod);
  const rsiValue = rsi(closePrices, rsiPeriod);

  const currentPrice = closePrices[closePrices.length - 1];
  const currentVolume = volumeData[volumeData.length - 1];

  const previousClose = closePrices[closePrices.length - 2];
  const previousVolume = volumeData[volumeData.length - 2];

  // Check for breakout
  const isBreakout = currentPrice > smaClose && currentPrice > previousClose;

  // Confirm breakout with volume spike
  const isVolumeSpike = currentVolume > volumeMultiplier * previousVolume;

  // Check RSI for overbought/oversold conditions
  const isOverbought = rsiValue > overboughtThreshold;
  const isOversold = rsiValue < oversoldThreshold;

  // Risk management
  const maxRiskPerTrade = 0.02 * portfolio.cash; // 2% of cash
  const positionSize = Math.floor(maxRiskPerTrade / currentPrice);

  const timestamp = historicalData[historicalData.length - 1].timestamp;

  // Entry conditions
  if (isBreakout && isVolumeSpike && !isOverbought) {
    if (!portfolio.positions[symbol]) {
      buy(symbol, positionSize, currentPrice, timestamp);
      console.log(`Bought ${positionSize} shares of ${symbol} at ${currentPrice}`);
    }
  }

  // Exit conditions
  if (portfolio.positions[symbol] && isOverbought) {
    sell(symbol, portfolio.positions[symbol].quantity, currentPrice, timestamp);
    console.log(`Sold ${portfolio.positions[symbol].quantity} shares of ${symbol} at ${currentPrice}`);
  }
}

function executeStrategy(symbol) {
  const { cash, positions } = portfolio;
  const { period, stdDevMultiplier, tradeSize } = parameters;
  const historicalData = data[symbol];

  if (historicalData.length < period) {
    console.warn('Not enough data to execute the strategy.');
    return;
  }

  const closePrices = historicalData.map(point => point.close);
  const movingAverage = sma(closePrices, period);
  const stdDev = calculateStdDev(closePrices, movingAverage, period);

  const upperBand = movingAverage + stdDevMultiplier * stdDev;
  const lowerBand = movingAverage - stdDevMultiplier * stdDev;

  const currentPrice = closePrices[closePrices.length - 1];
  const timestamp = historicalData[historicalData.length - 1].timestamp;

  if (currentPrice > upperBand && positions[symbol]) {
    // Price is above upper band, consider selling
    sell(symbol, positions[symbol].quantity, currentPrice, timestamp);
  } else if (currentPrice < lowerBand && cash >= tradeSize * currentPrice) {
    // Price is below lower band, consider buying
    buy(symbol, tradeSize, currentPrice, timestamp);
  }
}

function calculateStdDev(prices, movingAverage, period) {
  const squaredDiffs = prices.slice(-period).map(price => Math.pow(price - movingAverage, 2));
  const averageSquaredDiff = sma(squaredDiffs, period);
  return Math.sqrt(averageSquaredDiff);
}
